import Dropdown from "./Dropdown";
import Filteredchip from "./Filteredchip";
import Menubutton from "./Menubutton";

const Filter = () => {
  return (
    // Component
    // ⬇️⬇️⬇️⬇️
    <div id="filter">
      <div id="filter-box" className="flex justify-between items-center">
        {/* Filter chip */}
        <Filteredchip />
        {/* Hamburger menu button */}
        <Menubutton />
      </div>
      Dr
      <Dropdown />
    </div>
  );
};

export default Filter;
